		const listItems = listArray.map((list_item) =>
		  <li>{list_item}</li>
		);
		return (
			<ul>{listItems}</ul>
		);
	}*/

	render(){
		isLoginRequired(true);
		const listArray = this.props.listArray;
		const listItems = listArray.map((list_item, index) =>
		  <li key={index}>
		  	<p>
		  		<i>{list_item.id}</i> <b>{list_item.title}</b>
		  	</p>
		  </li>
		);
		return (
			<ul>{listItems}</ul>
		);
	}

}

export default List;
